#SHEINXRocktheRunway with @rileyclemmon to present the HOTTEST fashion event of the season!

🌟 TUNE IN: September 26 @ 2PM PDT on our livestream on SHEIN's free app as well as SHEIN's official YouTube, Twitter, Instagram and Facebook accounts!

We will also be featuring performances by renowned choreographers:
@calvitjr
@alexander.chung
@bryawoods
@nappytabs
@crystal.alysia
@larollergirls
@taylordeethomas
& More!

SHEIN's ROCK THE RUNWAY will also help to support and raise awareness and donations to benefit The Action Network. They are a mission-driven organization dedicated to building online power for the progressive movement. This will also support and raise awareness to benefit Youth Emerging Stronger to help build brighter futures for foster and homeless youth. 

SHEIN will be donating $350,000 across both charities! 💞
